import './App.css';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import Container from '@mui/material/Container';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import TextField from '@mui/material/TextField';
import SearchIcon from '@mui/icons-material/Search';



function App() {
  const cityname = "";
  function handleOnclick(){
    console.log(document.getElementById('citynameTextF').value)
    cityname = document.getElementById('citynameTextF').value;

  }
  return (
    <div className="App" >
     <br></br>
     <Box display="flex" justifyContent = "center" alignItems="center"  maxWidth="100">
      <TextField 
        id="citynameTextF" 
        variant="outlined" 
        size="small"  
      />
      &nbsp;&nbsp;
      <Button  id="search"  variant="outlined" onClick = {handleOnclick} startIcon={<SearchIcon/>}>Search</Button>

     </Box>
      <br></br><br></br>
      <Container sx = {{width: 275}} fixed >
        <Card sx={{ minWidth: 275 , width: 275 , borderRadius: '16px'}}>
        <CardContent>
          <Typography sx={{ fontSize: 20}} color="text.primary" gutterBottom>
            {cityname}
          </Typography>
          <Typography variant="h5" component="div">
            <img src='https://cdn-icons-png.flaticon.com/512/1163/1163662.png'
            height="100px"
            width="100px"/>
          </Typography>
          <Typography variant="h5" component="div">
            30 Â°C
          </Typography>
          <Typography sx={{ mb: 1.5 }} color="text.secondary">
            Clear
          </Typography>
        </CardContent>
      </Card>
      </Container>

    </div>
  );
}

export default App;
